import React from "react";
import PdfViewer from "./pdf-viewer";

function Guilds(){
    const PdfUrl="https://homebrewery.naturalcrit.com/share/lmwx4Ex7qJIw";

    return(
        <PdfViewer pdfUrl={PdfUrl}></PdfViewer>
    )
}

export default Guilds;
